INSERT INTO [dbo].[Pages] ([Id], [Name], [Title], [Content], [Language_Code], [Link_Code], [Description], [CreatedDate], [UpdatedDate], [CreatedBy], [UpdatedBy], [IsActive]) VALUES (N'21', N'3', N'Contact Us', N'<p><span style="font-size: 14pt; font-family: georgia,palatino,serif;"><span style="color: #000000;">General Information</span></span></p>
<p><span style="font-size: 12pt; font-family: georgia,palatino,serif;"><span style="color: #000000;">Tel:&nbsp;&nbsp; (855-23)&nbsp; 22 49 73</span></span></p>
<p><span style="font-size: 12pt; font-family: georgia,palatino,serif;"><span style="color: #000000;">Fax: (855-23)&nbsp; 22 49 72</span></span></p>
<p><span style="font-size: 12pt; font-family: georgia,palatino,serif;"><span style="color: #000000;">E-mail:&nbsp; <a title="cambodia evisa" href="mailto:cambodiaevisa@evisa.gov.kh">cambodiaevisa@evisa.gov.kh</a></span></span></p>', N'en', N'3', null, N'2015-12-07 10:39:42.377', N'2016-01-19 10:59:21.907', N'admin', N'admin', N'1');
GO
INSERT INTO [dbo].[Pages] ([Id], [Name], [Title], [Content], [Language_Code], [Link_Code], [Description], [CreatedDate], [UpdatedDate], [CreatedBy], [UpdatedBy], [IsActive]) VALUES (N'22', N'2', N'About e-Visa', N'<p><span style="color: #000000;">&nbsp;&nbsp;&nbsp;&nbsp; Cambodia e-Visa or Electronic Visa have been introduced by Ministry of Foreign Affairs and International Cooperation in April 2006 to prmote the Cambodia tourism inducstry . The website <a title="evisa" href="https://www.evisa.gov.kh" target="_blank">https://www.evisa.gov.kh</a> now server as a platform for tourists to apply Cambodia tourist Visa Online.</span></p>
<p><span style="color: #000000;">+ Why e-Visa</span></p>
<p><span style="color: #000000;">With e-Visa , you do not have to visit the Cambodia Embassy to apply your Visa. No submission of documents is required during the application process because e-Visa process from application to approval is completely done via the online platform. The proces is very straightforward where by the applications just need to fill up their details and submiste the payment thru the secure payment gateway with their credit card.</span></p>
<p><span style="color: #000000;">+ Is e-Visa legitimates ?</span></p>
<p><span style="color: #000000;">Yes, e-Visa is a project launched by the Cambodian Government and fully supported by MOFA. The following countries have authenticated the legitimacy of the e-Visa service:</span></p>
<p><span style="color: #000000;"><a title="Cambodia Embassy" href="http://www.cambodianembassy.org.uk/" target="_blank">http://www.cambodianembassy.org.uk/</a></span></p>
<p><span style="color: #000000;"><a title="embassy" href="http://www.embassyofcambodia.org.nz/au.htm" target="_blank">http://www.embassyofcambodia.org.nz/au.htm </a></span></p>', N'en', N'2', null, N'2015-12-07 10:53:01.953', N'2016-01-20 10:00:52.797', N'admin', N'outdom', N'1');
GO
INSERT INTO [dbo].[Pages] ([Id], [Name], [Title], [Content], [Language_Code], [Link_Code], [Description], [CreatedDate], [UpdatedDate], [CreatedBy], [UpdatedBy], [IsActive]) VALUES (N'23', N'1', N'E-Visa Make Your Trip Happen To The Kingdom Of Wonder !', N'<p>The Ministry of Foreign Affairs and International Cooperation has launched e-Visa, which enables you to apply for a Cambodia tourist visa online. Instead of applying through Cambodian Embassy, all you need to do is to complete the online application form and pay with your credit card. After receiving your Visa through email, print it out and bring it along when you travel to Cambodia.</p>', N'en', N'1', null, N'2015-12-07 11:40:51.100', N'2016-04-02 03:51:50.870', N'admin', N'admin', N'1');
GO
INSERT INTO [dbo].[Pages] ([Id], [Name], [Title], [Content], [Language_Code], [Link_Code], [Description], [CreatedDate], [UpdatedDate], [CreatedBy], [UpdatedBy], [IsActive]) VALUES (N'25', N'4', N'Passport Photograph Requirement for e-Visa', N'<p><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #333333;">Passport Photograph Requirement for e-Visa A digital photograph is required for each applicant while applying for an e-Visa and the photograph must meet certain criteria as follows:</span></p>
<ol>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #333333;">A full face, front view and open eyes</span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #333333;">Make sure photo presents full head from top of hair to shoulders</span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #333333;">Take the photo in a plain white or off-white background</span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #333333;">Avoid shadows on the face or background</span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #333333;"> Face in photo should have a natural expression (closed mouth)</span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #333333;"> Photos should not include sunglasses or hats</span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #333333;">The contrast and lighting in the photo should be normal</span></li>
</ol>
<p>&nbsp;</p>
<p><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt; color: #333333;"><img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/jpeg;base64," alt="" /><img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/png;base64," alt="" /></span></p>
<p><span style="font-family: arial,helvetica,sans-serif; font-size: 12pt;"><strong><span style="color: #333333;">Requirements for digital Photograph</span></strong></span></p>
<ul>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;"><strong><span style="color: #333333;">Acquisition&nbsp;&nbsp; :&nbsp; The image file may be produced by acquiring an image with a digital camera or by digitizing a paper photograph with a scanner.<br /></span></strong></span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;"><strong><span style="color: #333333;">Dimensions&nbsp; : Minimum acceptable dimensions are height=600 pixels and width=400 pixels. Maximum acceptable dimensions are height=1200 pixels and width=800 pixels.<br /></span></strong></span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;"><strong><span style="color: #333333;">Color&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Photo accepted color and black/white (black/white photo must be cleared and good quality),<br /></span></strong></span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;"><strong><span style="color: #333333;">File Format&nbsp;&nbsp; : Must be JPEG, PNG, BMP format (Jpeg, Png, Bmp extension)<br /></span></strong></span></li>
<li><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;"><strong><span style="color: #333333;">File Size&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;Must be less than 1MB</span></strong></span><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;"><strong><span style="color: #333333;">&nbsp; <br /></span></strong></span></li>
</ul>
<p style="text-align: justify;"><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif; color: #333333;">More guidelines can be found in our previous post. Of course, if you are not sure or have any problem with photo, you can always send to&nbsp;<a style="color: #333333;" title="photo@evisa.gov.kh" href="mailto:photo@evisa.gov.kh">photo@evisa.gov.kh. We are always happy to help our visitor to fix their photo. We also appreciate some of the feedback from our visitor after helping fixing their photo.<br /></a></span></p>', N'en', N'4', null, N'2015-12-07 15:30:21.307', N'2016-01-13 08:34:36.280', N'admin', N'admin', N'1');
GO
