INSERT INTO [dbo].[Pages] ([Id], [Name], [Title], [Content], [Language_Code], [Link_Code], [Description], [CreatedDate], [UpdatedDate], [CreatedBy], [UpdatedBy], [IsActive]) VALUES (N'29', N'7', N'Information', N'<h3>Visa Extension</h3>
<p>Tourist (T) and Business (E) visas can be extended visa to stay for 30 days at Camboida National Police Immigration Department, Ministry Of Interior.</p>
<p>Address : No. 332, Russian Boulevard, Opposite of the Phnom Penh International Airport, Phnom Penh , Cambodia.</p>
<p>Tel : (+855) 12 581 558 Fax: (+855) 23 890 101 / (+855) 23 890 439</p>
<p>Hotline ( 24 hours) : 012 826 025</p>
<h3>Required document</h3>
<ul>
<li>e-Visa certificate ( e-Visa holder)</li>
<li>Applicant''s passport - 2 photographs ( size 4 x 6 )</li>
<li>Approprivate visa fee + Processiong time : 2 business days&nbsp;</li>
<li>Application Tips Please enter your estimated entry date if you are not sure now.</li>
<li>Change your entry date at "Check &amp; Change" when you have the confirmed date.</li>
</ul>
<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img src="data:image/gif;base64," alt="" /></p>
<h3>Processing time</h3>
