INSERT INTO [dbo].[Pages] ([Id], [Name], [Title], [Content], [Language_Code], [Link_Code], [Description], [CreatedDate], [UpdatedDate], [CreatedBy], [UpdatedBy], [IsActive]) VALUES (N'36', N'1', N'E-visa ធ្វើឱ្យការធ្វើដំណើររបស់អ្នកកើតឡើងដើម្បីឱ្យព្រះរាជាណាចក្រអច្ឆរិយនេះ!', N'<p>ក្រសួងការបរទេសនិងសហប្រតិបត្តិការអន្តរជាតិបានចាប់ផ្តើមអ៊ីមែលទិដ្ឋាការដែលអាចឱ្យអ្នកដាក់ពាក្យសុំទិដ្ឋាការទេសចរណ៍មួយកម្ពុជាអនឡាញ។ ជំនួសឱ្យការអនុវត្តតាមរយៈស្ថានទូតកម្ពុជាទាំងអស់ដែលអ្នកត្រូវធ្វើគឺដើម្បីបំពេញសំណុំបែបបទកម្មវិធីលើបណ្តាញនិងការបង់ជាមួយនឹងកាតឥណទានរបស់អ្នក។ បន្ទាប់ពីទទួលបានទិដ្ឋាការរបស់អ្នកតាមរយៈអ៊ីម៉ែល, បោះពុម្ពចេញនិងនាំយកវានៅពេលដែលអ្នកធ្វើដំណើរតាមបណ្តោយទៅនឹងប្រទេសកម្ពុជា។</p>', N'kh', N'1', null, N'2016-05-17 09:11:20.187', N'2016-05-17 09:11:20.187', N'sokhom', N'sokhom', N'1');
GO
INSERT INTO [dbo].[Pages] ([Id], [Name], [Title], [Content], [Language_Code], [Link_Code], [Description], [CreatedDate], [UpdatedDate], [CreatedBy], [UpdatedBy], [IsActive]) VALUES (N'37', N'7', N'ពត៏មាន', N'<p>ពន្យាទិដ្ឋាការ</p>
<p>ទេសចរណ៍ (T) និងពាណិជ្ជកម្ម (E) ទិដ្ឋាការអាចពន្យារទិដ្ឋាការឱ្យស្នាក់នៅរយៈពេល 30 ថ្ងៃនៅ Camboida នាយកដ្ឋានអន្តោប្រវេសន៍នគរបាលជាតិក្រសួងមហាផ្ទៃ។<br />អាសយដ្ឋាន: លេខ 332, មហាវិថីសហព័ន្ធរុស្ស៊ី, ទល់មុខព្រលានយន្តហោះអន្តរជាតិភ្នំពេញ, ភ្នំពេញ, កម្ពុជា។<br />ទូរស័ព្ទ: (+855) 12 581 558 ទូរសារ: (+855) 23 890 101 / (+855) 23 890 439<br />លេខទូរស័ព្ទទំនាក់ទំនងបន្ទាន់ (24 ម៉ោង): 012 826 025<br />ឯកសារដែលត្រូវការ</p>
<p>អ៊ីមែលទិដ្ឋាការវិញ្ញាបនបត្រ (អ្នកកាន់អ៊ីមែលទិដ្ឋាការ)<br />លិខិតឆ្លងដែនរបស់បេក្ខជន - 2 រូបថត (ទំហំ 4 &times; 6)<br />តម្លៃទិដ្ឋាការ Approprivate + + ពេល Processiong: 2 ថ្ងៃនៃថ្ងៃធ្វើការ<br />ជំនួយការកម្មវិធីសូមបញ្ចូលកាលបរិច្ឆេទធាតុបានគេប៉ាន់ប្រមាណរបស់អ្នកប្រសិនបើអ្នកមិនប្រាកដឥឡូវនេះ។<br />ផ្លាស់ប្តូរកាលបរិច្ឆេទធាតុរបស់អ្នកនៅ "ពិនិត្យនិងផ្លាស់ប្តូរ" នៅពេលដែលអ្នកមានកាលបរិច្ឆេទបញ្ជាក់ថា។<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />ពេលកែច្នៃ</p>
<p>2 ថ្ងៃនៃថ្ងៃធ្វើការ</p>', N'kh', N'7', null, N'2016-05-17 09:19:05.220', N'2016-05-17 09:20:27.847', N'sokhom', N'sokhom', N'1');
GO
